import './App.css';
import NavBar from './components/NavBar.jsx';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.js';
import 'bootstrap/dist/js/bootstrap.min.js';
import 'bootstrap/dist/js/bootstrap.bundle.js';

function App() {
  return(

    <nav ClassName="navbar navbar-expand-lg navbar-dark bg-dark">
    <div ClassName="container-fluid">            
        <p>MENU DE MI PROGRAMA</p></div>
        <a ClassName="navbar-brand">PELICULAS DIGITALES</a>

                <button ClassName="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                 <span ClassName="navbar-toggler-icon"></span>
                </button>			

            <div ClassName="collapse navbar-collapse" id="navbarSupportedContent">
                <ul ClassName="navbar-nav ms-auto d-flex flex-row mt-3 mt-lg-0">

                <li ClassName="nav-item">
                    <a ClassName="nav-link" href="#">Inicio de Sesion</a>
                </li>

                <li ClassName="nav-item">
                    <a ClassName="nav-link" href="#">Mis Peliculas</a>
                </li>

                <li ClassName="nav-item">
                    <a ClassName="nav-link" href="#">Lista de Deseos</a>
                </li>

                <li ClassName="nav-item">
                    <a ClassName="nav-link" href="#">Carrito Compras</a>
                </li>

                </ul>


                <form ClassName="d-flex center-block w-auto ms-lg-3 my-3 my-lg-0 col-sm-6 offset-sm-3">
                    <input ClassName="form-control me-2" type="search" placeholder="Buscar" aria-label="Buscar"/> 
                    <button ClassName="btn btn-primary" type="submit">Buscar</button>
                </form>
            </div>
   </nav>

  // <div className="App">    
  //     <nav><p>MENU DE MI PROGRAMA</p></nav>      
  // </div>

  );
}

export default App;
